import React from 'react';
import Form from './Form';
import styled from 'styled-components';

const Fondo = styled.main`
  background-image : url("https://somosbelcorpprd.s3.amazonaws.com/EventoFestivo/login.jpg");
  background-repeat: no-repeat;
  max-width: 100%;

`;



const Login = (props) => {

  return (
    <>
      <Fondo >
        <div className='container d-flex fill-available justify-content-center align-items-center col-lg-6 py-3 d-flex align-items-center form-style flex-column'>
          <Form logprop={props} />
        </div>
      </Fondo>
    </>
  )
}
export default Login
